(function(){var app,core,restStore,utils;core=require('../../core.js');utils=require('../../utils.js');restStore=require('../../restapi/store.js');app=getApp();core.Page({data:{meta:null,content:''},swipe_point:null,onLoad:function(opts){var self;self=this;self.tab_route=opts.tab_route;return self.load();},load:function(){var self;self=this;self.setData({loaded:false});return restStore.page.get('splash').then(function(page){app.set_navbar(page.meta.title);return self.setData({meta:page.meta,content:page.content,loaded:true});});},swipe_start:function(e){var self;self=this;try{return self.swipe_point={x:e.changedTouches[0].clientX,y:e.changedTouches[0].clientY};}catch(error){return self.swipe_point=null;}},swipe_end:function(e){var changed_x,changed_y,end_point,self;self=this;if(!self.swipe_point){return;}
try{end_point={x:e.changedTouches[0].clientX,y:e.changedTouches[0].clientY};}catch(error){return;}
changed_x=Math.abs(end_point.x-self.swipe_point.x);changed_y=Math.abs(end_point.y-self.swipe_point.y);if(changed_x>120&&changed_y<changed_x){self.swipe_point=null;return self.skip();}},skip:function(){var self;self=this;if(self.tab_route){return app.nav.tab({route:self.tab_route});}else{return app.nav.back();}}});}).call(this);